			date: "11,Jul 2023",
			title: "Exploring the Fundamentals of Cybersecurity: A B.Tech Student’s Perspective",
			body: "As a B.Tech student, diving into the world of cybersecurity has been both fascinating and intimidating. In an increasingly digital world, understanding how to protect systems, data, and networks from malicious threats is becoming a critical skill. Throughout my coursework and personal interest in cybersecurity, I’ve discovered how foundational concepts like encryption, network security, and ethical hacking not only protect information but also ensure the trustworthiness of the digital world. One of the first concepts I encountered was encryption, which is essential for safeguarding sensitive data. Encryption algorithms, such as AES (Advanced Encryption Standard), are used to secure communications between servers and clients. I realized that understanding how encryption works is vital not only for protecting passwords and credit card numbers but also for building trust in online transactions. I applied this knowledge while working on a project to build a secure login system that utilized encrypted user passwords, which was a practical demonstration of how cryptography protects user privacy. Network security was another area that piqued my interest. As businesses and governments store more data online, securing networks from potential threats becomes critical. I explored tools like Wireshark for network analysis and learned how attackers can intercept data in unprotected networks. I also experimented with firewall configurations and VPNs to better understand how networks can be shielded from unauthorized access. These hands-on exercises helped me understand how robust firewalls and intrusion detection systems prevent attacks such as Man-in-the-Middle (MITM) or Distributed Denial of Service (DDoS). Ethical hacking, or penetration testing, was a turning point in my journey. I learned how ethical hackers use the same techniques as malicious attackers, but in a legal and constructive manner, to find vulnerabilities in systems. I tried tools like Kali Linux and learned about common attacks such as SQL Injection and Cross-Site Scripting (XSS). By performing vulnerability assessments, I understood the importance of patching security holes before attackers can exploit them. This exploration of cybersecurity has not only increased my knowledge of security protocols but also shaped how I approach coding and problem-solving. As I continue to learn about emerging threats like ransomware, social engineering, and AI-powered attacks, I’m motivated to deepen my skills in ethical hacking and network security. Cybersecurity isn’t just about defending against attacks; it's about staying one step ahead, ensuring systems are resilient and reliable for everyone.",
